// App.js

import React from 'react';
import { BrowserRouter as Router, Route, Link, Switch } from 'react-router-dom';
import MakePayment from './MakePayment';
import CheckStatus from './CheckStatus';

const App = () => {
    return (
        <Router>
            <div>
                <nav>
                    <ul>
                        <li>
                            <Link to="/">Home</Link>
                        </li>
                        <li>
                            <Link to="/make-payment">Make Payment</Link>
                        </li>
                        <li>
                            <Link to="/check-status">Check Payment Status</Link>
                        </li>
                    </ul>
                </nav>

                <Switch>
                    <Route path="/make-payment">
                        <MakePayment />
                    </Route>
                    <Route path="/check-status">
                        <CheckStatus />
                    </Route>
                    <Route path="/">
                        <Home />
                    </Route>
                </Switch>
            </div>
        </Router>
    );
};

const Home = () => {
    return <h2>Home</h2>;
};

export default App;
